function enviarMesanje(type, msg, title, position, showclosebutton) {
    if (position == null || position == "") {
        toastr.options.positionClass = "toast-top-right";
    } else {
        toastr.options.positionClass = position;
    }
    if (
        showclosebutton == null ||
        showclosebutton == "" ||
        showclosebutton == "true"
    ) {
        toastr.options.closeButton = "true";
    }
    toastr.options.timeOut = "5000";
    toastr.options.progressBar = true;
    switch (type) {
        case "success":
            toastr.success(msg, title);
            break;
        case "info":
            toastr.info(msg, title);
            break;
        case "warning":
            toastr.warning(msg, title);
            break;
        case "error":
            toastr.error(msg, title);
            break;
    }
    // toastr.clear();
}

function formatoFecha(fecha, formato) {
    const map = {
        dd: fecha.getDate(),
        mm: fecha.getMonth() + 1,
        yy: fecha.getFullYear().toString().slice(-2),
        yyyy: fecha.getFullYear(),
    };

    return formato.replace(/dd|mm|yy|yyy/gi, (matched) => map[matched]);
}

function getDiaActualFechaCorta() {
    Date.prototype.mes = function () {
        var m = this.getMonth() + 1; // getMonth() is zero-based
        return (m > 9 ? "" : "0") + m;
    };

    Date.prototype.date = function () {
        var d = this.getDate(); // getMonth() is zero-based
        return (d > 9 ? "" : "0") + d;
    };

    Date.prototype.segundos = function () {
        var s = this.getSeconds();
        return (s > 9 ? "" : "0") + s;
    };

    var date = new Date();
    var dateFormat = date.getFullYear() + "-" + date.mes() + "-" + date.date();

    return dateFormat;
}

function getDiasEntreDosFechas(f1, f2) {
    var aFecha1 = f1.split("/");
    var aFecha2 = f2.split("/");
    var fFecha1 = Date.UTC(aFecha1[2], aFecha1[1] - 1, aFecha1[0]);
    var fFecha2 = Date.UTC(aFecha2[2], aFecha2[1] - 1, aFecha2[0]);
    var dif = fFecha2 - fFecha1;
    var dias = Math.floor(dif / (1000 * 60 * 60 * 24));
    return dias;
}

function getDiaActualFechaLarga() {
    Date.prototype.mes = function () {
        var m = this.getMonth() + 1; // getMonth() is zero-based
        return (m > 9 ? "" : "0") + m;
    };

    Date.prototype.date = function () {
        var d = this.getDate(); // getMonth() is zero-based
        return (d > 9 ? "" : "0") + d;
    };

    Date.prototype.segundos = function () {
        var s = this.getSeconds();
        return (s > 9 ? "" : "0") + s;
    };

    var date = new Date();
    var dateFormat =
        date.getFullYear() +
        "-" +
        date.mes() +
        "-" +
        date.date() +
        " " +
        date.getHours() +
        ":" +
        date.getMinutes() +
        ":" +
        date.segundos();
    return dateFormat;
}

function onSelectEdificioChange() {
    // =====================================================================
    // Cargar combo Unidades dependiendo del Edificio
    // =====================================================================

    var id_edificio = $(this).val();
    if (!id_edificio) {
        $("#select_unidad").html(
            '<option value="0">Seleccione Unidad</option>'
        );
        return;
    }

    var ruta_unidades_por_edificio =
        ruta_raiz + "edificios/" + id_edificio + "/unidades";
    $.get(ruta_unidades_por_edificio, function (data) {
        var html_select = "";
        html_select = '<option value="0">Seleccione Unidad</option>';
        for (var i = 0; i < data.length; ++i) {
            html_select +=
                '<option value="' +
                data[i].id_unidad +
                '">' +
                data[i].descripcion +
                "</option>";
            $("#select_unidad").html(html_select);
        }
    });

    $("#select_unidad").attr("disabled", false);
}

